"original": |2-
        The value is a quoted-string containing one or more positive
        integers separated by the "/" character (for example, "1", "1/2",
        or "1/2/5").  If more than one version of a particular KEYFORMAT
        is defined, this attribute can be used to indicate which
        version(s) this instance complies with.  This attribute is
        OPTIONAL; if it is not present, its value is considered to be "1".
        Use of the KEYFORMATVERSIONS attribute REQUIRES a compatibility
        version number of 5 or greater.
"fixed": |-
  - The value is a quoted-string containing one or more positive integers separated by the "/" character (for example, "1", "1/2", or "1/2/5").  If more than one version of a particular KEYFORMAT is defined, this attribute can be used to indicate which version(s) this instance complies with.  This attribute is OPTIONAL; if it is not present, its value is considered to be "1". Use of the KEYFORMATVERSIONS attribute REQUIRES a compatibility version number of 5 or greater.
"ko": |-
  - 값은 "/" 문자로 구분된 하나 이상의 양의 정수를 포함하는 따옴표 붙은 문자열입니다(예: "1", "1/2" 또는 "1/2/5"). 특정 KEYFORMAT의 버전이 두 개 이상 정의된 경우 이 속성을 사용하여 이 인스턴스가 준수하는 버전을 나타낼 수 있습니다. 이 속성은 선택사항입니다. 존재하지 않는 경우 해당 값은 "1"로 간주됩니다. KEYFORMATVERSIONS 속성을 사용하려면 호환성 버전 번호 5 이상이 필요합니다.
